import * as PIXI from "pixi.js";

const PreviewImage = () => {
  let type = "WebGL";
  if (!PIXI.utils.isWebGLSupported()) {
    type = "canvas";
  }

  PIXI.utils.sayHello(type);

  return (
    <div className={`reading-progress-bar`}>
